    false,nt"url": null,nt"notes": "This narrative report for Crab Orchard
    National Wildlife Refuge outlines Refuge accomplishments from September through
    December of 1962. Wildlife- including migratory birds, upland game birds, big game
    animals, furbearers, predators, rodents, raptors, fish, and disease- is also covered.
    The Refuge development and maintenance section discusses physical developments,
    plantings, vegetation control, and wildfires. Resource management is outlined; topics
    include grazing, haying, timber removal, and commercial fishing. A progress report
    on field investigations and applied research is also provided. The public relations
    section of the report describes recreational uses, Refuge visitors, Refuge participation,
    hunting, violations, and safety. Items of interest, N-R forms, and photographs are
    attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
